import React, { Component } from "react";

class TeamMemberList extends Component {
  state = {};
  render() {
    const style = {
      "padding-top": "10px",
      "padding-bottom": "10px"
    };
    return (
      <div>
        <input type="text" placeholder="Enter name" style={style} />
      </div>
    );
  }
}

export default TeamMemberList;
